import Button from "./buttonEdit/Button";


export default function EditProfile() {


    //Array de parametros 'chave=valor'
var params = window.location.search.substring(1).split('&');

//Criar objeto que vai conter os parametros
var paramArray = {};

//Passar por todos os parametros
for(var i=0; i<params.length; i++) {
    //Dividir os parametros chave e valor
    var param = params[i].split('=');

    //Adicionar ao objeto criado antes
    paramArray[param[0]] = param[1];
    console.log(paramArray)
}

    function componentDidMount(){

        fetch(`http://localhost:8081/updateUser/`, {
            method: 'PUT',
            headers: {
                'Authorization':localStorage.getItem('token')
    }
        }).then(function(response) {
        console.log(response);
        }).catch(function (response) {
        console.log(response);
        });
}
    
        return(
            <div>
                <h2>Tela de editar perfil</h2>
                <br/>
                <div>
                    <form className="form">
                    <text>Editar Perfil</text>
                    <br/>
                        <label>
                            Especificação:
                            <input type="text" />
                        </label>
                        <br/>
                        <label>
                            Telefone:
                            <input type="text" />
                        </label>
                        <div>
                        
                        <Button buttonSize='btn--large' type="submit">Editar</Button>
                        </div>
                    </form>
                    
                </div>
            </div>
        )
    

}
